import {Frame, Banner, ContentNav, Footer} from '../frame/frame.js';
import '../upload.css';

function Upload(){
    return(
        <div>
        <Frame/>
        <Banner name={'데이터 업로드'}/>
        <ContentNav/>
            <div className='uploadContentBox'>
                <div className="uploadBox">
                    <div>파일 업로드 관련 설명</div>
                    <div className="fileBox">파일 이미지 들어있는 박스</div>
                    <div>
                        <button>제출</button>
                        <button>취소</button>
                    </div>
                </div>
                <div className="uploadBox">데이터 업로드 화면</div>
            </div>
        <Footer/>
        </div>
    );
}


export default Upload;
